import {Routes, Route} from 'react-router-dom';
import Home from './Home';

const AllRoutes = () =>{

    return(
        <Routes>
            <Route exact key="home" path="/" element={<Home/>}/>
        </Routes>
    )
}

export default AllRoutes;
